import React from "react";
import { Card, Row, Col } from "react-bootstrap";
const Phone = (props) => {
  return (
    <div>
      <Container>
        <Row>
          <Card style={{ width: "12rem", border: `none`, magin: `0` }}>
            <Card.Img variant="top" src={props.details.imgUrl} />
            <Card.Body>
              <Card.Title> {props.phone.name}</Card.Title>
              <Card.Text>
                <p>{props.phone.price}</p>
              </Card.Text>
            </Card.Body>
          </Card>
        </Row>
      </Container>
      <h2>{props.phone.name}</h2>
      <h2>{props.phone.price}</h2>
    </div>
  );
};

export default Phone;
